export default (function(a,b,c,d,e,f,g,h,i,j,k,l){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:c,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:a,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:a,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:a,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:c,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}},{id:2784,attributes:{type:a,item_lang:{data:{id:3451,attributes:{title:"Renfield",slug:"renfield"}}}}},{id:2788,attributes:{type:a,item_lang:{data:{id:3455,attributes:{title:"The Killer",slug:"the-killer"}}}}},{id:2790,attributes:{type:a,item_lang:{data:{id:3457,attributes:{title:"The Color Purple",slug:"the-color-purple"}}}}},{id:2798,attributes:{type:c,item_lang:{data:{id:3465,attributes:{title:"Silo",slug:"silo"}}}}},{id:2802,attributes:{type:c,item_lang:{data:{id:3469,attributes:{title:"The Night Agent",slug:"the-night-agent"}}}}}],meta:{pagination:{page:h,pageSize:25,pageCount:h,total:10}}},Z0eItP9T02:{data:{id:638,attributes:{imdbId:"tt0844471",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTg0MjAwNDI5MV5BMl5BanBnXkFtZTcwODkyMzg2Mg@@._V1_SX300.jpg",type:a,ratings:[{Source:"Internet Movie Database",Value:"6.9\u002F10"},{Source:"Rotten Tomatoes",Value:"86%"},{Source:"Metacritic",Value:"66\u002F100"}],item_lang:{data:{id:1301,attributes:{title:i,plot:"Flint Lockwood thinks he's a genius. But none of the things he invented are things that make sense or are useful. However, he has the support of his mother but when she dies, he's left alone with his father who thinks he should give it up. When the community that he lives in is in an economic crisis because their primary source of income, a sardine cannery, was shut down, Flint decides to try his latest invention, a machine that can turn water into food. But something goes wrong and the machine ends up in the atmosphere. Later it starts raining food. The shifty mayor tries to use this as a way to help their community, but when Flint senses something wrong with the machine, the mayor convinces him to ignore it. However, as Flint predicts, chaos ensues.",slug:"cloudy-with-a-chance-of-meatballs"}}},books:{data:[{id:4354,attributes:{title:"Cloudy With a Chance of Meatballs",description:"An imaginative story of amazing food weather that inspired the hit movie, Cloudy with a Chance of Meatballs is a favorite of grown-ups and children everywhere. The tiny town of Chewandswallow was very much like any other tiny town—except for its weather which came three times a day, at breakfast, lunch, and dinner. But it never rained rain and it never snowed snow and it never blew just wind. It rained things like soup and juice. It snowed things like mashed potatoes. And sometimes the wind blew in storms of hamburgers. Life for the townspeople was delicious until the weather took a turn for the worse. The food got larger and larger and so did the portions. Chewandswallow was plagued by damaging floods and storms of huge food. The town was a mess and the people feared for their lives. Something had to be done, and in a hurry.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=fQU6UrNfe4MC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:true,published:"1982-04-01",publisher:"Atheneum Books for Young Readers",subtitle:f}},{id:4355,attributes:{title:i,description:"The tiny town of Chewandswallow was very much like any other tiny town except for its weather which came three times a day, at breakfast, lunch and dinner. But it never rained rain and it never snowed snow and it never blew just wind. It rained things like soup and juice. It snowed things like mashed potatoes. And sometimes the wind blew in storms of hamburgers. Life for the townspeople was delicious until the weather took a turn for the worse. The food got larger and larger and so did the portions. Something has to be done in Chewandswallow...and in a hurry.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=upa6sQ6lYx0C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:d,published:"2011-06-14",publisher:e,subtitle:"With Audio Recording"}},{id:4356,attributes:{title:j,description:k,thumbnail:l,authors:[b],firstBook:d,published:g,publisher:e,subtitle:f}},{id:4357,attributes:{title:"Cloudy With a Chance of Meatballs 3",description:"Cloudy with a chance of…pie?! An all-new Cloudy with a Chance of Meatballs adventure takes foodie fun to—Mars! Breaking News: Astronauts Land on Mars! Kate and Henry can hardly believe their eyes. Astronauts have landed on Mars! And their first discovery there? A thick glutinous substance that seems to be falling from the sky. A substance not unlike...pie filling? Could it be? Could it be raining pies on Mars? Suddenly, Mars seems a whole lot more inviting—and delicious!—than it ever has before. And more will be revealed. Because it just so happens that Grandpa has some very personal experience with these Martians. And, even more importantly, with the pies.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=D7UzRu4ecXAC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:d,published:g,publisher:e,subtitle:"Planet of the Pies (with audio recording)"}},{id:4358,attributes:{title:j,description:k,thumbnail:l,authors:[b],firstBook:d,published:g,publisher:e,subtitle:f}}]}}},meta:{}}},prerenderedAt:1688531308383}}("movie","Judi Barrett","series",null,"Simon and Schuster","","2013-08-27",1,"Cloudy with a Chance of Meatballs","Grandpa's Cloudy With a Chance of Meatballs Cookbook","Square meatballs. Sunrise mashed potatoes. Lemon blizzard parfaits. It’s dinnertime, Cloudy with a Chance of Meatballs style, and you get to be the chef! The tiny town of Chewandswallow is known for its edible weather: soup rain, mashed potato snow, and hamburger windstorms. And now people everywhere can also enjoy the delectable dishes featured in the bestselling Cloudy with a Chance of Meatballs. Grandpa has been hard at work editing and compiling his favorite recipes, and he’s ready to share. However, this is Grandpa we’re talking about, so don’t expect a dry, straightforward collection. No, in addition to his thorough directions on how to make everything from Strawberry Tallcake to—oh yes, yes, yes—Meatballs, this spiral-bound book is filled with clever asides and scrumptious illustrations. From the Foggy Pea Soup to the Hamburgers Heading Toward Earth, these legendary recipes are delicious and easy to follow—so you can re-create culinary scenes from a cherished classic (no umbrellas necessary).","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=-J0Nt5hss2MC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api"))